script: |
  super -f text -I q11378.spq | sort > q11378.out

inputs:
  - name: q11378.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NULL > NULL AND NOT ( col2 * col2 / col1 + tab1.col0 + + col2 * + col2 ) NOT IN ( - col0 * col0 );
  - name: tab1

outputs:
  - name: q11378.out
    data: |
